<template>
  <article class="login default-login-page">
    <div class="login-wrapper">
      <div class="title">
        {{ "巡查养护系统" }}
      </div>
      <div class="img">
        <!-- <image :src="logImg" alt="" /> -->
      </div>

      <div class="form">
        <!-- 用户名 -->
        <u-input
          placeholder="请输入用户名"
          v-model="username"
          clearable
          color="#667085"
          border="bottom"
        ></u-input>
        <!-- 密码 -->
        <u-input
          placeholder="请输入密码"
          v-model="password"
          :type="pwdType"
          clearable
          color="#667085"
          border="bottom"
          @confirm="handleLogin"
        >
          <!-- <template #suffix>
            <div
              v-if="!showPwd"
              class="pwd-icon param-icon-bns_noshow-eye-nodisplay"
              @click="changeStatus(true)"
            ></div>
            <div
              v-else
              class="pwd-icon param-icon-bns_show-eye-display"
              @click="changeStatus(false)"
            ></div>
          </template> -->
        </u-input>
        <!-- 验证码 -->
        <div v-if="needVerifyCode" class="verify-box">
          <u-input
            placeholder="请输入验证码"
            v-model="verifyCode"
            color="#4F555A"
            border="bottom"
          >
            <template #suffix>
              <u-image
                :src="verifyImg"
                width="150"
                height="40"
                radius="5px"
                mode="scaleToFill"
                @click="handleRefreshVerifyImg"
              ></u-image>
            </template>
          </u-input>
        </div>
        <!-- 记住密码 -->
        <u-checkbox-group v-model="rememberLogin">
          <u-checkbox
            shape="circle"
            activeColor="#018C83"
            label="记住密码"
            :name="1"
            :labelSize="16"
          ></u-checkbox>
        </u-checkbox-group>

        <u-button
          class="login-btn"
          color="linear-gradient(270deg, #008673 0%, #8AD37D 100%)"
          @click="handleLogin"
          >登 录</u-button
        >
      </div>
    </div>

    <message ref="msgRef"></message>

    <u-toast ref="toastRef"></u-toast>
  </article>
