<script lang="ts" setup>
// import logImg from "@/assets/imgs/login/backImg.jpg";
import { ref } from "vue";
import userApi from "@/api/user.api";
import md5 from "js-md5";
import { onLoad } from "@dcloudio/uni-app";
import { message } from "../../control/message";
import { useUserStore } from "@/stores/user";

const username = ref("");
const password = ref("");
const verifyCode = ref("");
const showPwd = ref(false);
const pwdType = ref("password");
const rememberLogin = ref([]);
const toastRef = ref();
const needVerifyCode = ref(false);
const verifyImg = ref("");

const msgRef = ref();
const userStore = useUserStore();

// 登录
function handleLogin() {
  // 校验
  if (!username.value || !password.value) {
    toastRef.value.show({
      type: "error",
      title: "请输入账号或密码",
      message: "请输入账号或密码",
    });
    return;
  }

  uni.showToast({
    title: "登录中",
    icon: "loading",
  });
  console.log("rememberLogin", rememberLogin.value);
  userApi
    .login({
      account: username.value,
      password: md5(password.value),
      rememberMe: rememberLogin.value[0] ? 1 : 0,
      verificationCode: verifyCode.value,
    })
    .then(async (res) => {
      if (res.code == 200 && res.data?.token) {
        // 保存登录信息
        // 如果要记住登录状态，将refreshToken存到本地
        userStore.afterLogin(res.data);
      } else {
        // 判断是否需要输入/刷新验证码
        setTimeout(() => {
          isRequireVerifyCode();
        }, 500);
      }
    })
    .catch(async (err) => {
      // 判断是否需要输入/刷新验证码
      setTimeout(() => {
        isRequireVerifyCode();
      }, 500);
    });
}
// 切换密码输入状态
function changeStatus(status: boolean) {
  showPwd.value = status;
  pwdType.value = status ? "text" : "password";
}
// 刷新验证码图片
async function handleRefreshVerifyImg() {
  const res = await userApi.selectVerificationCode({ account: username.value });
  console.log("img", res);
  if (res.code == 200) {
    verifyImg.value = res.data.img;
  }
}
// 是否需要输入验证码
async function isRequireVerifyCode() {
  const res = await userApi.isRequireVerificationCode({
    account: username.value,
  });
  console.log("isrequire", res);
  if (res.code == 200) {
    needVerifyCode.value = res.data;
    if (res.data) {
      handleRefreshVerifyImg();
    }
  }
}

onLoad(() => {
  // 判断是否记住了登录状态
  const RefreshToken = uni.getStorageSync("RefreshToken");
  console.log("cc", RefreshToken);
  if (RefreshToken) {
    //有登录状态，换取新的token
    userApi.loginRefreshToken({ account: RefreshToken }).then((res) => {
      if (res.code == 200 && res.data.token) {
        userStore.setToken(res.data.token);
        uni.setStorageSync("token", res.data.token);
        // 直接进入首页
        userStore.fetchUserInfo().then(() => {
          uni.reLaunch({ url: "/pages/home/home" });
          return false;
        });
      } else {
        message.toast("登录失败", "err");
        return false;
      }
    });
  }
});
</script>

